import React from 'react';
import axios from 'axios';
import { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Header from './components/header';
import Footer from './components/footer';
import Requestform from './components/Pages/requestform';
import Login from './components/Pages/login-form';
import Home from './components/Pages/home';
import Admin from './components/Pages/admin';
import UserDashboard from './components/Pages/userdashboard';

function App() {
	const [listofUsers, setListofUsers] = useState([]);

	useEffect(() => {
		axios.get('http://localhost:3001/Users').then((response) => {
			console.log(response.data);
		});
	}, []);

	return (
		<div>
			<div className='app'>
				{listofUsers.map((value, key) => {
					return (
						<div className='users'>
							<div className='fname'>{value.f_name}</div>
							<div className='mname'>{value.m_name}</div>
							<div className='lname'>{value.l_name}</div>
							<div className='contact'>{value.f_name}</div>
							<div className='email'>{value.m_name}</div>
							<div className='username'>{value.l_name}</div>
						</div>
					);
				})}
			</div>

			<Router>
				<Header />
				<Routes>
					<Route path='/' element={<Login />} />
					<Route path='/requestform' element={<Requestform />} />
					<Route path='/home' element={<Home />} />
					<Route path='/admin' element={<Admin />} />
					<Route path='/userdashboard' element={<UserDashboard />} />
				</Routes>
			</Router>
			<Footer />
		</div>
	);
}

export default App;
